import React from 'react'
import { NavLink } from 'react-router-dom';
import web from './2.svg';
import Common from './Common'
const Home=()=>{
    return(
        <>
        <Common text="Grow your business with" 
        img={web}
        visit="/contact"
        btnname="Contact Now" />
        </>
    )
}
export default Home;
